import axios from 'axios'
import React from "react";

function FazerReserva(){

    
        const puxar = async () => {
            axios.get(`http://127.0.0.1:8000/fazer-reserva/`)
            .then((response) => {
                console.log(response)
                }).catch(function(error){
            console.log(error)
        })
            };
            puxar(); 
        
    const Cadastrar = async ()  => {
        let locatario = document.getElementById("locatario").value
        let data = document.getElementById("data").value
        let sala = document.getElementById("sala").value


        try{
            axios.post('http://127.0.0.1:8000/reservas/', {
            locatario:locatario,
            data : data,
            sala : sala,
          })
          .then(function (response) {
         console.log('foi', response)
          })
        }catch(error){
            console.log(error)
        }
    }
    return(
        <div className="main">
            <div className='div_cadastro'>
                <h3>Tela de Cadastro de Reserva</h3>
                <label>
                Pick a fruit:
                <select name="sala" id='sala'>
                    <option value="banana">Banana</option>
                </select>
                </label>
                <input placeholder="data" id="data"></input>
                <input placeholder="locatario" type="number" id="locatario"></input>
                
                <button onClick={()=>Cadastrar()}>
                    Cadastrar
                </button>
            </div>
        </div>
    )


}export default FazerReserva
